import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Route, BrowserRouter, Redirect } from 'react-router-dom';
import HomePage from './HomePage';
import About from './About';
import Projects from './Projects';
import Skills from './Skills';
import './bootstrap-social.css';

function App() {
  const handleSelect = (key) => {
    console.log(key);
    alert(key);
    debugger;
  }
  return (
    <BrowserRouter>
    {/* <Redirect to ="/home" /> */}
    <div className="App">    
      <header className="App-header">
      <nav class="navbar navbar-expand-lg navbar-light bg-light home-navbar">
        <a class="navbar-brand" href="/home"> <strong>Dhwan Shah</strong></a>
        <div class="collapse navbar-collapse navbar-items" id="navbarNavAltMarkup">
          <div class="navbar-nav navbar-items">
            <a class="nav-item nav-link navbar-individual" eventKey={1} href="home">Home <span class="sr-only">(current)</span></a>
            <a class="nav-item nav-link navbar-individual" eventKey={2} href="projects">Projects</a>
            <a class="nav-item nav-link navbar-individual" eventKey={3} href="about">About</a>
            <a class="nav-item nav-link navbar-individual" eventKey={4} href="skills">Skills</a>
          </div>
        </div>
      </nav>
        {/* <Route path="/" component = {HomePage} /> */}
        <Route path="/home" component={HomePage} />
        <Route path="/projects" component={Projects} />
        <Route path="/about" component={About} />
        <Route path="/skills" component={Skills} />
      </header>

      <div class="card stack-top container">
        <div class="card-body">
        <h5 class="card-title pop-up-card-text">
          I AM THE CSS &#123;...&#125; TO YOUR HTML &lt;&#47;&gt;
        </h5>
          <button type="button" class="btn btn-warning">
            <a href="/home">
            render(Website)
            </a>
          </button>
          <button type="button" class="btn btn-warning">
            <a href="/images/Dhwan_Shah_FT.pdf" download="Dhwan Shah Resume" role="button">
            console.log(Resume)
            </a>
          </button>
        </div>
      </div>
      <footer class="footer navbar-fixed-bottom">
        {/* <div> */}
        <div class="container">
          CONNECT
          <div class="social-icons">
                    <a href="https://www.linkedin.com/in/dhwanshah21/" class="btn btn-primary btn-social btn-linkedin">
                    <i class="fab fa-linkedin"></i></a>
                    <a href="https://github.com/dhwanshah21/" class="btn btn-primary btn-social btn-github">
                    <i class="fab fa-github"></i></a>
                    <a href="https://mailto:shahdhwan@gmail.com" class="btn btn-primary btn-social btn-google">
                    <i class="fas fa-envelope-square"></i>
                    </a>
        </div>
        </div>

        {/* </div> */}
      </footer>
    </div>
    </BrowserRouter>
  );
}

export default App;
